var title_f7_26_7593="Pedunculated gastric carcinoid";
var content_f7_26_7593=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F81095%7EGAST%2F73158%7EGAST%2F53130&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F81095%7EGAST%2F73158%7EGAST%2F53130&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Gastric carcinoid",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 427px; height: 268px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Low power view demonstrates a solitary, pedunculated gastric carcinoid.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     From Lewin KJ, Appelman HD. Tumors of the esophagus and stomach. Atlas of Tumor Pathology (electronic fascicle), Third series, Fascicle 18, 1996, Washington, DC. Armed Forces Institute of Pathology.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Type I gastric carcinoids",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 389px; height: 313px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Endoscopic picture of the gastric corpus in a patient with pernicious anemia demonstrates multiple polypoid masses that were shown to be carcinoids, type I.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     From Lewin KJ, Appelman HD. Tumors of the esophagus and stomach. Atlas of Tumor Pathology (electronic fascicle), Third series, Fascicle 18, 1996, Washington, DC. Armed Forces Institute of Pathology.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 537px\">",
"   <div class=\"ttl\">",
"    Gastric carcinoid",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 517px; height: 227px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A total of three nodular appearing lesions were seen in the body of the stomach, measuring between 5 by 5 mm to 15 by 5 mm. Two had small ulcerations (arrows), which were presumably the site of bleeding. Image A represents a frontal view and image B is during retroflexion.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Andres Gelrud, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
