"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F72160&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
