var title_f7_26_7599="Pathogenesis of PBC";
var content_f7_26_7599=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F73762&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F73762&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pathogenesis of primary biliary cirrhosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 530px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The initial requirement is a genetically susceptible host, which may involve an inability to suppress an immunologically mediated attack on bile duct cells once it has begun. Some triggering event is required to set this process in motion; it could be any event that damages bile duct cells and exposes the unique PBC bile duct cell antigen to the cellular or humoral immune system. Progressive damage to bile duct cells causes cholestasis. This sets up a vicious cycle in which retention of toxic substances, such as bile acids, cause chemical damage to hepatocytes. Cholestasis also causes increased expression of HLA Class I and II antigens on bile duct cells and hepatocytes which make them better targets for activated lymphocytes. The gradual loss of bile ducts causes progressive scarring, cirrhosis, portal hypertension and eventually, liver failure.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
